function Personaje () {
    personaje = sprites.create(assets.image`miImagen0`, SpriteKind.Player)
    info.setLife(3)
    controller.moveSprite(personaje, 100, 0)
    personaje.ay = 300
    tiles.placeOnTile(personaje, tiles.getTileLocation(190, 7))
    scene.cameraFollowSprite(personaje)
    scaling.scaleToPercent(personaje, 60, ScaleDirection.Uniformly, ScaleAnchor.Middle)
}
